description:
Batman, Gordon and Harvey Dent are forced to deal with the chaos unleashed by a terrorist mastermind known only as the Joker, 
as he drives each of them to their limits.

Batman raises the stakes in his war on crime. With the help of Lieutenant Jim Gordon and District Attorney Harvey Dent, 
Batman sets out to dismantle the remaining criminal organizations that plague the city streets. The partnership proves to be effective, 
but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as The Joker.

